import React, { useState } from 'react';
import './PatientForm.css';

const PatientForm = () => {
  const [formData, setFormData] = useState({
    name: '',
    age: '',
    gender: '',
    phone: '',
    address: '',
    date: '',
    referredBy: '',
    maritalStatus: '',
    chiefComplaint: [],
    medicalHistory: [],
    allergies: '',
    medications: '',
    dentalHistory: [],
    ccOther: '',
    dhOther: '',
    showChiefComplaint: false,
    showMedicalHistory: false,
    showDentalHistory: false,
    clinicalFindings: {
      first: [],
      second: [],
      third: [],
      fourth: [],
    },
    showQuadrant: {
      first: false,
      second: false,
      third: false,
      fourth: false,
    }
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleCheckboxChange = (key, value) => {
    setFormData((prev) => {
      const updated = prev[key].includes(value)
        ? prev[key].filter(item => item !== value)
        : [...prev[key], value];
      return { ...prev, [key]: updated };
    });
  };

  const toggleQuadrant = (q) => {
    setFormData(prev => ({
      ...prev,
      showQuadrant: { ...prev.showQuadrant, [q]: !prev.showQuadrant[q] },
    }));
  };

  const handleToothChange = (quadrant, toothNumber, field, value) => {
    setFormData(prev => {
      const updatedQuadrant = [...(prev.clinicalFindings[quadrant] || [])];
      const index = updatedQuadrant.findIndex(t => t.toothNumber === toothNumber);

      if (index !== -1) {
        updatedQuadrant[index].condition[field] = value === 'true';
      } else {
        const newCondition = { cavity: false, mobility: false, missing: false, filling: false };
        newCondition[field] = value === 'true';
        updatedQuadrant.push({
          toothNumber,
          condition: newCondition,
        });
      }

      return {
        ...prev,
        clinicalFindings: {
          ...prev.clinicalFindings,
          [quadrant]: updatedQuadrant,
        },
      };
    });
  };

  const renderToothRow = (quadrantName) => {
    const teeth = ['11', '12', '13', '14', '15', '16', '17', '18'];
    return (
      <table className="tooth-table">
        <thead>
          <tr>
            <th>Tooth No.</th>
            <th>Cavity</th>
            <th>Mobility</th>
            <th>Missing</th>
            <th>Filling</th>
          </tr>
        </thead>
        <tbody>
          {teeth.map(tooth => (
            <tr key={`${quadrantName}-${tooth}`}>
              <td>{tooth}</td>
              {['cavity', 'mobility', 'missing', 'filling'].map(field => (
                <td key={field}>
                  <select onChange={(e) => handleToothChange(quadrantName, tooth, field, e.target.value)}>
                    <option value="false">--</option>
                    <option value="true">Yes</option>
                  </select>
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    );
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData);
    alert('Patient data saved successfully!');
  };

  return (
    <div className="form-container">
      <h2>Dental OP Case Sheet</h2>
      <form onSubmit={handleSubmit}>
        {/* Previous Sections Here - Patient Info, Chief Complaint, Medical History, Dental History */}

        {/* Clinical Findings Section */}
        <fieldset>
          <legend>Clinical Findings (Select Tooth-wise)</legend>

          {['first', 'second', 'third', 'fourth'].map((q, idx) => (
            <div className="quadrant-section" key={q}>
              <button type="button" className="dropdown-toggle" onClick={() => toggleQuadrant(q)}>
                {`Quadrant ${idx + 1}`}
              </button>
              {formData.showQuadrant[q] && renderToothRow(q)}
            </div>
          ))}

        </fieldset>

        <button type="submit">Save Patient</button>
      </form>
    </div>
  );
};

export default PatientForm;
